import React, { useEffect } from 'react'
import { useNavigate, useParams } from 'react-router-dom';
import { useState } from 'react';

const DetailsOfQuestion = () => {
    const [data,setData]=useState([]);
    const params=useParams();
    const questionId = params.questionId;
    const topicName=params.topicName;
    const navigate=useNavigate();
    console.log("Topic Name....>",topicName);
    console.log("Question Id...>",questionId);
    async function questionDetails()  {
        console.log("question Details is called....");
        console.log(questionId);
        const map = {
          questionId: questionId,
        };
    
        const response = await fetch(
          "https://localhost:8443/onlineexam/control/questionMasterList",
          {
            method: "POST",
            credentials: "include",
            body: JSON.stringify(map),
            headers: {
              "Content-type": "application/json",
            },
          }
        );
    
        const result = await response.json();
        console.log("result....>",result);
        const myobj = result.getRecord;
        console.log("Myobj....>",myobj);
        setData(result.getRecord);
        console.log("Data..>",data);
        console.log(result.getRecord);
      };
      useEffect(() => {
        questionDetails();
      }, []);
  return (
    <table>
        <thead>
            <tr>
                <th>Option A</th>
                <th>Option B</th>
                <th>Option C</th>
                <th>Option D</th>
                <th>Option E</th>
                <th>Answer</th>
                <th>Question Detail</th>
            </tr>
        </thead>
        <tbody>
          
            <td>
                {data.optionA}
              
            </td>
            <td>
            {data.optionB}
            </td>
            <td> {data.optionC}</td>
            <td> {data.optionD}</td>
            <td>{data.optionE}</td>
            <td>{data.answer}</td>
            <td> {data.questionDetail}</td>
            <td>  {topicName}</td>
          </tbody>
        <button className="btn btn-primary" onClick={navigate(`updateExam/examDetails/question-topicview/view-questions/${questionId}/${topicId}`)}>Back</button>
    </table>
  )
}

export default DetailsOfQuestion
